#!/bin/bash
# Run this script from this directory to import the scopes into the terraform state.
source ../environments/localhost/config.env
cd ../
# =========================================================
exec_terraform_import() {
  resource_address=$1
  scope_id=$2
  if terraform state list | grep -q "${resource_address}"; then
     echo "Resource already managed. Skipping import for ${resource_address}"
  else
    IMPORT_OUTPUT=$(terraform import -input=false -var-file="/Users/brad/Documents/GitHub/zedwerks/mustimuhw_smart_keycloak/terraform/environments/localhost/variables.tfvars" "${resource_address}" "${scope_id}" 2>&1)
    IMPORT_EXIT_CODE=$?
    if [ $IMPORT_EXIT_CODE -ne 0 ]; then
      if echo "$IMPORT_OUTPUT" | grep -q "already managed by Terraform"; then
         echo "[INFO] Resource already managed: ${resource_address}"
         return 0
      elif echo "$IMPORT_OUTPUT" | grep -q "Cannot import"; then
         echo "[WARN] Missing configuration or invalid import format."
         return 1
      elif echo "$IMPORT_OUTPUT" | grep -q "Configuration for import target does not exist"; then
         echo "[WARN] The Resource ${resource_address} is not in the Configuration. Skipping."
         return 0
      elif echo "$IMPORT_OUTPUT" | grep -q "Invalid resource address"; then
         echo "[ERROR] Invalid resource address format."
         exit 3
      elif echo "$IMPORT_OUTPUT" | grep -q "Error importing"; then
         echo "[ERROR] Provider-specific import error. At ${resource_address} "
         exit 4
      else
         echo "[ERROR] Unknown failure: $IMPORT_OUTPUT"
         exit 1
      fi
    else
      echo "[SUCCESS] Imported: ${resource_address}"
      terraform state show "${resource_address}"
    fi
  fi
}
